import {Outlet} from 'react-router-dom'
import GoogleMapReact from 'google-map-react';
import greenwich_center from "./components/greenwich_center.js";
import styled from 'styled-components';
import { Loader } from "@googlemaps/js-api-loader"


const Wrapper = styled.main`
  width: 100%;
  height: 100%;
`;




const App = () => {

	return (   
    <div className='App'>
			<header className='App-header'>
				<h1 style={{ fontSize:36, paddingLeft:'8px', paddingTop:'4px', color:'white' }}>#BTW</h1>
				<LoginSidebar placement='end'/>
			</header>
    <div className='map-container' style={{ height: '10vh', width: '100%' }}>
      <Outlet/>
      <Map/>
     </div>

     </div>
	)
}

export default App
